import React from 'react';

const Underline = () => {
  return (
    <svg width="10" height="10" xmlns="http://www.w3.org/2000/svg">
      <text
        transform="translate(-10 -11)"
        fill="#101622"
        fillRule="evenodd"
        fontSize="13"
        fontFamily="Baskerville-SemiBold, Baskerville"
        fontWeight="500"
      >
        <tspan x="10" y="20">
          U
        </tspan>
      </text>
    </svg>
  );
};

export default Underline;
